import React from 'react';
import ParkCard from './ParkCard';

function ParkList ({ parks }){

  const newParkData = parks;
  console.log(newParkData);
  
  const parkData = newParkData.map( park => 
        <ParkCard
          key={park.id}
          name={park.fullName}
          image={park.images[0].url}
          description={park.description}
          activities ={park.activities}
          admission = {park.entranceFees.cost}
          addressLine1 = {park.addresses[0].line1}
          addressLine2 = {park.addresses[0].city}
          addressLine3 = {park.addresses[0].stateCode}
          addressLine4 = {park.addresses[0].postalCode}
        />)
  
    return (
      <ul className="cards">{parkData}</ul>
    );
  }
  


export default ParkList;
